func (c *current) onEscapeSequence1(char any) (any, error) {
	var charStr string
	switch v := char.(type) {
	case string:
		charStr = v
	case []uint8:
		charStr = string(v)
	default:
		charStr = fmt.Sprintf("%v", char)
	}

	switch charStr {
	case "n":
		return "\n", nil
	case "t":
		return "\t", nil
	case "r":
		return "\r", nil
	case "\\":
		return "\\", nil
	case "\"":
		return "\"", nil
	case "'":
		return "'", nil
	default:
		return "\\" + charStr, nil
	}
}

